  [],\n\t\"revision_timestamp\": \"2016-07-27T22:24:11.019363\",\n\t\"name\": \"kirwin-national-wildlife-refuge-annual-narrative-report-calendar-year-1994\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kirwin
  National Wildlife Refuge summarizes refuge activities during the 1994 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  Land acquisition including fee title is also covered. The report includes a planning
  section which discusses master plans, management plans and public participation.
  \ Refuge administration is outlined; information about personnel, other manpower
  programs, volunteer programs, funding, safety, and other is given.  Habitat management
  is also covered.  Subjects include general, wetlands, forests, croplands, grasslands,
  grazing, haying, fire management, pest control, and wilderness and special areas,
  and Partneru2019s for Wildlife.  The wildlife section of the report discusses wildlife
  diversity, endangered and/or threatened species, waterfowl, marsh and water birds,
  shorebirds, gulls, terns and allied species, raptors, other migratory birds, game
  mammals, other resident wildlife, and fisheries resources and disease prevention
  and control.  The public uses of the refuge described in this report include general,
  outdoor classrooms u2013students, interpretive foot trails, interpretive tour routes,
  interpretive exhibits/demonstrations, other interpretive programs, hunting, fishing,
  wildlife observation, other wildlife oriented recreation, camping, law enforcement
  and concessions.  The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment utilization
  and replacement, communications systems, and energy conservation.  Items of interest
  are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
